pragma solidity ^0.8.19;

library Math {
    function abs(uint256 x, uint256 y) internal pure returns (uint256) {
        return x >= y ? x - y : y - x;
    }
}

// 添加了getLogm(), calculatepopularity()
// 修改了addLiqudity()，swap()
contract CAMM {

    event output(string,uint256);
    IERC20 public immutable token0;
    IERC20 public immutable token1;

    // Number of tokens
    uint256 private constant N = 2;

    uint256 private constant A = 2000;

    uint256 private constant DECIMALS = 18;

    uint256 private reserve0;
    uint256 private reserve1;

    uint256 public totalSupply;
    mapping(address => uint256) public balanceOf;

    ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
        // 0. ERC20 base feature
    ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////

    constructor(address _token0, address _token1) {
        token0 = IERC20(_token0);
        token1 = IERC20(_token1);
    }

    function _mint(address _to, uint256 _amount) private {
        balanceOf[_to] += _amount;
        totalSupply += _amount;
    }

    function _burn(address _from, uint256 _amount) private {
        balanceOf[_from] -= _amount;
        totalSupply -= _amount;
    }

    function _update(uint256 _reserve0, uint256 _reserve1) private {
        reserve0 = _reserve0;
        reserve1 = _reserve1;
    }


    ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
        // 1. 提供查询和返回的函数 函数类型external
    ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////


    // precise exchange rate * 1e13 (Big exchange rate)
    uint256 private floatingPointPrecision = 1e13;
    function exchange_rate(
        address _tokenIn, uint256 _amountIn
    ) external view returns (uint256 BigamountOut) {

        require(_tokenIn == address(token0) || _tokenIn == address(token1), "invalid token");
        require(_amountIn > 0, "amount in = 0");

        uint256 BigAmountIn = floatingPointPrecision * _amountIn;

        uint256 Bigfee = BigAmountIn* lastPopularity / popularity_precision;
        uint256 BigamountInWithFee = BigAmountIn - Bigfee;    // deduct fee


       //输入token0输出token1，或者输入token1输出token0
        bool isToken0 = _tokenIn == address(token0);
        (uint256 reserveIn, uint256 reserveOut)
        = isToken0
            ? (reserve0, reserve1)
            : (reserve1, reserve0);


        uint256 BigreserveOut = reserveOut * floatingPointPrecision;
        uint256 BigreserveIn = reserveIn * floatingPointPrecision;

        // Calculate dy
        uint256 Bigx = (BigreserveIn + BigamountInWithFee); //入度的钱加上了新转移的钱
        uint256 Bigy0 = BigreserveOut;   //出度的钱
        uint256 Bigy1 = _getY(Bigx, (BigreserveIn + BigreserveOut));

        // y0 must be >= y1, since x has increased
        // -1 to round down
        uint256 Bigdy = (Bigy0 - Bigy1 - 1);
        BigamountOut = Bigdy;
    }
    function getpopularity() public view returns(uint256){
        return lastPopularity;
    }

    function getToken0() external view returns(IERC20){return token0;}
    function getToken1() external view returns(IERC20){return token1;}
    function getoperator() external view returns(address){return msg.sender;}
    function getProtocoladdr() external view returns(address){return address(this);}
    function getProtocoladdrBalance(address addr) external view returns(uint256){return token0.balanceOf(addr);}
    function getApproveToken0(address owner, address spender)external view returns(uint256){return token0.allowance(owner,spender);}
    function getApproveToken1(address owner, address spender)external view returns(uint256){return token1.allowance(owner,spender);}

    uint256 tmp_reserveIn;
    function getreserveIn()external view returns(uint256){return tmp_reserveIn;}

    uint256 tmp_reserveOut;
    function getreserveOut()external view returns(uint256){return tmp_reserveOut;}

    uint256 tmp_amountIn;
    function getlastamountIn()external view returns(uint256){return tmp_amountIn;}
    uint256 tmp_dy;
    function getlastdy()external view returns(uint256){return tmp_dy;}
    uint256 tmp_y0;
    function getlasty0()external view returns(uint256){return tmp_y0;}
    uint256 tmp_y1;
    function getlasty1()external view returns(uint256){return tmp_y1;}



    ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
        // 2. 计算popularity(热度)的函数
    ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////

    uint256 private lastSwapTimestamp;      //上一次的时间间隔
    uint256 private lastDeltaT=MaxDeltaT * 3;
    uint256 private lastPopularity = 500;   //上一次的热度


    // 基于swap的频率，计算calculateFee
    uint256 private MaxDeltaT = 10 * 24 * 3600; // 设定时间范围为 1s - 10 * 24 * 3600 十天最多
    uint256 private MinDeltaT = 1;
    // uint256 divisions = 10;
    // uint256 interval = (MaxDeltaT-MinDeltaT-1)/divisions;
    uint256 private interval = 5;

    uint256 private exponent_numbda = 1;
    uint256 private MaxTimefactor = 100;
    uint256 private y_parameter = MaxTimefactor / exponent_numbda;  // exponent_numbda越小越平缓，越大下降越快

    // 指数分布 f(x;numda)=numba * e^(-numda*x) = numbda * 1 / (e^[numbda*x])   numbda*x = p
    // e^p = 1+ p^2/1*2 + p^3/1*2*3 + ... + p^i / i!
    function calculate_Timefactor(uint256 x_numerator, uint256 x_denominator)private view returns(uint256){    
        // uint256 e = 27182818284590;    // e * floatingPointPrecision
        uint256 Maxnum = 1e23;

        // uint256 p = numbda * x ;
        uint256 p_numerator = exponent_numbda * x_numerator;
        uint256 p_denominator = x_denominator;

        // e^p = 1+ p^2/1*2 + p^3/1*2*3 + ... + p^i / i!
        uint256 eP = 1 * floatingPointPrecision;

        uint256 item_numerator = 1;
        uint256 item_denominator = 1;

        for (uint256 i=2;i<15;i++){
            item_numerator = item_numerator * p_numerator;
            item_denominator = item_denominator * p_denominator * i;
            if (item_numerator * floatingPointPrecision < item_denominator)break;
            eP = eP + item_numerator * floatingPointPrecision / item_denominator;
            if (item_numerator > Maxnum && item_denominator > Maxnum){
                item_numerator = item_numerator / 1e10;
                item_denominator = item_denominator / 1e10;
            }
            if (eP > exponent_numbda * 100 * floatingPointPrecision)break;
        }

        return exponent_numbda * 100 * floatingPointPrecision/ eP;

    }


    uint256 popularity_precision = 1e6;

    function calculatepopularity() private view returns (uint256) {
        uint256 _deltaT = lastDeltaT;
        uint256 _interval = interval;
        uint256 TimeFactor= calculate_Timefactor(_deltaT, _interval);   // [0,100] %%

        //popularity [0,1000]
        uint256 popularity = (3 * lastPopularity + 70 * TimeFactor)/10;

        if (popularity>999)popularity = 999;    //十万分之一千    1%
        if (popularity<100)popularity = 100;    ////十万分之一百 0.1%
        return popularity;
    }



    ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
        // 3. CAMM 的dy计算函数
    ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////

    function _getD() private view returns (uint256) {
        uint256 a = A * N; // An^n

        uint256 s; // x_0 + x_1 + ... + x_(n-1)
        uint256 xp0 = token0.balanceOf(address(this))*1e18;
        uint256 xp1 = token1.balanceOf(address(this))*1e18;
        s = xp0+xp1;

        uint256 d = s;
        uint256 d_prev;
        for (uint256 i; i < 255; ++i) {
            // p = D^(n + 1) / (n^n * x_0 * ... * x_(n-1))
            uint256 p = d;
            p=(p*d)/(2*xp0);
            p=(p*d)/(2*xp1);
            d_prev = d;
            d = ((a * s + 2 * p) * d) / ((a - 1) * d + 3 * p);

            if (Math.abs(d, d_prev) <= 1) {
                return d;
            }
        }
        revert("D didn't converge");
    }

    function _getY(
        uint256 x, //入度的钱多加上了转移的钱
        uint256 D //原来的钱的总量  D<<x
    ) private pure returns (uint256) {
        uint256 a = A * 2;  //4000
        uint256 d = D;
        uint256 s;
        uint256 c = d;
        s = x;
        c = (c * d) / (2 * x);
        c = (c * d) / (2 * a);
        uint256 b = s + d / a;
        // Newton's method
        uint256 y_prev;
        // Initial guess, y <= d
        uint256 y = d;
        for (uint256 _i; _i < 255; ++_i) {
            if (y <= 1)return 0;      // prevent overflow, break for y = 0
            if (2 * y + b  < d + 1)return 0;      // prevent overflow, break for y = 0
            y_prev = y; 
            y = (y * y + c) / (2 * y + b - d);

            if (Math.abs(y, y_prev) <= 1) {
                return y;
            }
        }
        revert("y didn't converge");
    }


    ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
        // 4. CAMM 的swap函数
    ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////

    function dispense_fee_to_LPProvider(IERC20 tokenIn, uint256 fee)private {

        for (uint k=0;k<LPprovider.length;k++){
           IERC20(tokenIn).transfer(LPprovider[k], fee * balanceOf[LPprovider[k]]/ totalSupply);
        }
    }

    function swap(
        address _tokenIn, uint256 _amountIn, uint256 minDy
    ) external returns (uint256 amountOut) {

        require(_tokenIn == address(token0) || _tokenIn == address(token1), "invalid token");
        require(_amountIn > 0, "amount in = 0");

        _update(token0.balanceOf(address(this)), token1.balanceOf(address(this)));        

        lastDeltaT = block.timestamp - lastSwapTimestamp;   // 记录交易时间
        if (lastDeltaT > MaxDeltaT) lastDeltaT = MaxDeltaT * 3;
        lastSwapTimestamp = block.timestamp;
        lastPopularity = calculatepopularity(); // 更改上一次Popularity

        uint256 fee = _amountIn* lastPopularity / popularity_precision;
        uint256 _amountInWithFee = _amountIn - fee;    // deduct fee

       //输入token0输出token1，或者输入token1输出token0
        bool isToken0 = _tokenIn == address(token0);
        (IERC20 tokenIn, IERC20 tokenOut, uint256 reserveIn, uint256 reserveOut)
        = isToken0
            ? (token0, token1, reserve0, reserve1)
            : (token1, token0, reserve1, reserve0);

        emit output("_amountInWithFee",_amountInWithFee);
        IERC20(tokenIn).transferFrom(msg.sender, address(this), _amountIn);

        // Calculate dy
        uint256 x = (reserveIn + _amountInWithFee); //入度的钱加上了新转移的钱
        uint256 y0 = reserveOut;   //出度的钱

        tmp_reserveIn = reserveIn;
        tmp_reserveOut = reserveOut;
        tmp_y0 = y0;
        uint256 y1 = _getY(x, (reserveIn + reserveOut));
        tmp_y1 = y1;
        // y0 must be >= y1, since x has increased
        // -1 to round down
        uint256 dy = (y0 - y1 - 1);
        require(dy >= minDy, "dy < min");
        IERC20(tokenOut).transfer(msg.sender, dy);

        // record parameters
        tmp_reserveIn = reserveIn;
        tmp_reserveOut = reserveOut;
        tmp_y0 = y0;
        tmp_y1=y1;
        tmp_dy = dy;
        tmp_amountIn=_amountIn;

        // fee分给LP provider, deduct 10% fee for CAMM
        dispense_fee_to_LPProvider(tokenIn, fee - fee/10);

        // Update balances
        _update(token0.balanceOf(address(this)), token1.balanceOf(address(this)));

        amountOut = dy;
    }


    ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
        // 5. CAMM 的add liquidity函数和remove liquidity函数
    ////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////



    address[] private LPprovider;


    function addLiquidity(
        uint256 _amount0,
        uint256 _amount1,
        uint256 minShares
    ) external returns (uint256 shares) {

        bool flag=false;
        for (uint i=0;i<LPprovider.length;i++){
            if (LPprovider[i]==msg.sender)flag=true;
        }
        if (flag==false)LPprovider.push(msg.sender);

        uint256 _xp0 = token0.balanceOf(address(this));
        uint256 _xp1 = token1.balanceOf(address(this));


        // add liquidity
        IERC20(token0).transferFrom(msg.sender, address(this), _amount0);
        IERC20(token1).transferFrom(msg.sender, address(this), _amount1);

        // Update balances
        _update(token0.balanceOf(address(this)), token1.balanceOf(address(this)));

        // calculate current liquidity d0
        uint256 _totalSupply = totalSupply;
        uint256 d0;
        if (_totalSupply > 0) {
            d0 = (_xp0+_xp1);
        }

        // Calculate new liquidity d1
        uint256 d1 = (_xp0+_xp1+_amount0+_amount1);
        require(d1 > d0, "liquidity didn't increase");

        // deduct fee
        uint256 d2 = (_xp0+_xp1+_amount0+_amount1);

        // Shares to mint = (d2 - d0) / d0 * total supply

        if (_totalSupply > 0) {
            shares = ((d2 - d0) * _totalSupply) / d0;
        } else {
            shares = d2;
        }
        shares = shares;

        require(shares >= minShares, "shares < min");

        _mint(msg.sender, shares);
    }

    function removeLiquidity(
        uint256 _shares,
        uint256 _minAmountsOut0,
        uint256 _minAmountsOut1
    ) external returns (uint256 amount0, uint256 amount1){

        uint256 bal0 = token0.balanceOf(address(this));
        uint256 bal1 = token1.balanceOf(address(this));

        amount0 = (_shares * bal0) / totalSupply;
        amount1 = (_shares * bal1) / totalSupply;
        require(amount0 > _minAmountsOut0, "amount0 < min");
        require(amount1 > _minAmountsOut1, "amount0 or amount1 = 0");

        _burn(msg.sender, _shares);
        _update(bal0 - amount0, bal1 - amount1);

        IERC20(token0).transfer(msg.sender, amount0);
        IERC20(token1).transfer(msg.sender, amount1);
    }

}


interface IERC20 {
    function totalSupply() external view returns (uint256);
    function balanceOf(address account) external view returns (uint256);
    function transfer(
        address recipient,
        uint256 amount
    ) external returns (bool);
    function allowance(
        address owner,
        address spender
    ) external view returns (uint256);
    function approve(address spender, uint256 amount) external returns (bool);
    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) external returns (bool);
}





contract ERC20Token0_CAMM is IERC20 {
    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(
        address indexed owner, address indexed spender, uint256 value
    );

    uint256 public totalSupply;
    mapping(address => uint256) public balanceOf;
    mapping(address => mapping(address => uint256)) public allowance;
    string public name;
    string public symbol;
    uint8 public decimals;

    constructor(string memory _name, string memory _symbol, uint8 _decimals) {      //单位:whatever    //计算费用的时候乘上10**decimals
        name = _name;
        symbol = _symbol;
        decimals = _decimals;
    }

    function transfer(address recipient, uint256 amount)
        external
        returns (bool)
    {
        balanceOf[msg.sender] -= amount;
        balanceOf[recipient] += amount;
        emit Transfer(msg.sender, recipient, amount);
        return true;
    }

    function approve(address spender, uint256 amount) external returns (bool) {
        allowance[msg.sender][spender] = amount;
        emit Approval(msg.sender, spender, amount);
        return true;
    }

    function transferFrom(address sender, address recipient, uint256 amount)
        external
        returns (bool)
    {
        allowance[sender][msg.sender] -= amount;
        balanceOf[sender] -= amount;
        balanceOf[recipient] += amount;
        emit Transfer(sender, recipient, amount);
        return true;
    }

    function _mint(address to, uint256 amount) internal {
        balanceOf[to] += amount;
        totalSupply += amount;
        emit Transfer(address(0), to, amount);
    }

    function _burn(address from, uint256 amount) internal {
        balanceOf[from] -= amount;
        totalSupply -= amount;
        emit Transfer(from, address(0), amount);
    }

    function mint(address to, uint256 amount) external {
        _mint(to, amount);
    }

    function burn(address from, uint256 amount) external {
        _burn(from, amount);
    }

}


